def solve(tuples):
    chain1 = []
    chain2 = []
    for i in range(len(tuples)):
        if i % 2 == 0:
            chain1.append(tuples[i])
        else:
            chain2.append(tuples[i])
    sum1 = sum(chain1)
    sum2 = sum(chain2)
    return sum1 + sum2

def solve(tuples):
    result = 0
    for i in range(0, len(tuples), 2):
        result += sum(tuples[i])
    return result

